import React, { useState } from 'react';

function Cart({ recommendedProducts }) {
  const [cartProducts, setCartProducts] = useState([]);

  // Function to move a product to the cart
  const moveProductToCart = (productIndex) => {
    const productToMove = recommendedProducts[productIndex];
    setCartProducts([...cartProducts, productToMove]);
  };

  return (
    <div className="cart">
      <h2>Cart</h2>
      {cartProducts.map((product, index) => (
        <div key={index} className="cart-item">
          {product}
        </div>
      ))}
    </div>
  );
}

export default Cart;
